%pyspark

def seq2dataset(seq, wndsize: int):
    dataset = []
    for i in range(len(seq) - wndsize):
        subset = seq[i : (i + wndsize + 1)]  # wndsize 만큼의 크기를 갖는 subset 생성
        dataset.append(subset)  # subset들을 갖는 dataset 생성
    return np.array(dataset)

# 손실 이력 클래스 정의
class LossHistory(Callback):
    def init(self):
        self.losses = []

    def on_epoch_end(self, batch, logs={}):
        self.losses.append(logs.get('loss'))
